Microsoft Step By Step Home &amp; Student 2010.

Teach yourself exactly what you need to know about using Microsoft Word, Excel(R), PowerPoint, and OneNote one step at a time! With STEP BY STEP, you build and practice new skills hands-on, at your own pace. Topics include creating effective documents; using themes, templates, and other formatting tools; building spreadsheets to perform calculations and manage data; producing and delivering compelling presentations; digitally organizing your notes and to-do lists; and other core topics. You get practice files on CD, along with a complete eBook.

